INSERT INTO Courses (title, image, description, duration, rating, abilities, available, Teacher_user_id, Category_course_id)
VALUES 
('Mishis en el Espacio 🚀🐾', 'https://cdn.pixabay.com/photo/2024/03/20/16/37/ai-generated-8645899_1280.png', '¡Bienvenidos al emocionante curso "Mishis en el Espacio"! 🌌 Este curso está diseñado para explorar el fascinante mundo de los gatos 🐱 en el contexto del espacio. A lo largo de las lecciones, descubriremos la historia de los gatos en la exploración espacial 🛰️, sus características únicas y cómo se adaptan a entornos de microgravedad. 🌠\n\nAdemás, abordaremos el impacto emocional ❤️ de tener un compañero felino en la vida de los astronautas 👩‍🚀 y la importancia de su bienestar en misiones prolongadas. 🛸 A través de actividades interactivas, videos educativos 📹 y debates 🗣️, los participantes aprenderán sobre la ciencia detrás de la convivencia de los mishis en el espacio y cómo esto puede inspirar futuras misiones. 🚀✨ ¡Únete a nosotros para descubrir cómo estos adorables felinos podrían ser parte de la próxima aventura espacial! 🌟🐾', '6', 1.0, 'Historia de los gatos en el espacio 🐱🌌;Adaptación a la microgravedad 🌠;Bienestar animal en el espacio ❤️🐾;Impacto emocional de los mascotas 👩‍🚀✨;Actividades interactivas y juegos 🎮🛸', false, 1, 3),
